import mobileTarif from "./mobile_tarif.png";

export function ServiceCard() {
    return (
        <div className="frame" style={{
          width: '1440px',
          minHeight: '900px',
          background: '#af9370b2',
          padding: '20px',
          position: 'relative'
        }}>
          {/* Logo and Tagline */}
          <div className="logo-section" style={{
            position: 'absolute',
            top: '50px',
            left: '100px',
            textAlign: 'center'
          }}>
            <h1 className="logo" style={{
              fontFamily: 'Inspiration',
              fontSize: '64px',
              color: '#ffc073',
              WebkitTextStroke: '2px #000000',
              margin: '0'
            }}>IS-COM</h1>
            <p className="tagline" style={{
              fontFamily: 'Handjet',
              fontSize: '36px',
              color: '#ffc073',
              WebkitTextStroke: '1px #000000',
              textAlign: 'center',
              marginTop: '10px'
            }}>ваш надежный провайдер!</p>
          </div>
    
          {/* Navigation Buttons */}
          <div className="nav-buttons" style={{
            position: 'absolute',
            top: '23px',
            right: '30px',
            display: 'flex',
            gap: '20px'
          }}>
            <button className="nav-button" style={{
              width: '129px',
              height: '40px',
              background: '#ffa940',
              borderRadius: '15px',
              border: '1px solid #000000',
              fontFamily: 'Handjet',
              fontSize: '32px',
              cursor: 'pointer'
            }}>Услуги</button>
            <button className="nav-button" style={{
              width: '129px',
              height: '40px',
              background: '#ffa940',
              borderRadius: '15px',
              border: '1px solid #000000',
              fontFamily: 'Handjet',
              fontSize: '32px',
              cursor: 'pointer'
            }}>Заявки</button>
          </div>
    
          {/* Main Content Card */}
          <div className="content-card" style={{
            position: 'absolute',
            top: '206px',
            left: '370px',
            width: '700px',
            padding: '20px',
            background: '#ffc07340',
            borderRadius: '15px'
          }}>
            <h2 style={{
              fontFamily: 'Kyiv*Type Titling',
              fontSize: '40px',
              color: '#a65b00',
              WebkitTextStroke: '1px #000000',
              textAlign: 'center',
              marginBottom: '20px'
            }}>Домашний интернет</h2>
            
            <img 
              src="https://dashboard.codeparrot.ai/api/image/Z9khVSppvFKitUVW/105927-1.png"
              alt="Home Internet"
              style={{
                width: '428px',
                height: '241px',
                borderRadius: '15px',
                display: 'block',
                margin: '0 auto'
              }}
            />
            
            <p style={{
              fontFamily: 'Handjet',
              fontSize: '24px',
              color: '#000000',
              textAlign: 'center',
              marginTop: '20px',
              maxWidth: '416px',
              margin: '20px auto'
            }}>
              Быстрый и надежный интернет для вашего дома. Стабильное соединение, выгодные тарифы, поддержка 24/7.
            </p>
          </div>
        </div>
      );
}
